tps://nhathuoclongchau.com.vn/benh/suy-than-679.html\">suy chức năng thận</a>.</p>\n<h3>L&agrave;m g&igrave; khi qu&ecirc;n 1 liều?</h3>\n<p>Nếu qu&ecirc;n d&ugrave;ng một liều thuốc, h&atilde;y uống c&agrave;ng sớm c&agrave;ng tốt khi nhớ ra. Tuy nhi&ecirc;n, nếu gần với liều kế tiếp, h&atilde;y bỏ qua liều đ&atilde; qu&ecirc;n v&agrave; uống liều kế tiếp v&agrave;o thời điểm như kế hoạch. Kh&ocirc;ng uống gấp đ&ocirc;i liều đ&atilde; quy định.</p>\n</div>','2009/2010/2011',1,'2024-09-30 09:32:27',168,'2024-10-08 14:28:52',168,NULL,1975,38176),(160,3240,'common',10000,9000,1000,8,'active',194,'<div id=\"detail-content-1\" class=\"usage\">\n<h2 class=\"css-8uyn92\">C&ocirc;ng dụng của Hỗn dịch uống Phosphalugel</h2>\n<div>\n<h3>Chỉ định</h3>\n<p>Thuốc&nbsp;<a href=\"https://nhathuoclongchau.com.vn/thuoc/phosphalugel-2611.html\">Phosphalugel</a>&nbsp;được chỉ định d&ugrave;ng trong c&aacute;c trường hợp sau:</p>\n<ul>\n<li>&ETH;iều trị cơn đau, bỏng r&aacute;t v&agrave; t&igrave;nh trạng kh&oacute; chịu do axit g&acirc;y ra ở dạ d&agrave;y hoặc thực quản.</li>\n</ul>\n<h3>Dược lực học</h3>\n<p>Phosphalugel l&agrave; một&nbsp;<a href=\"https://nhathuoclongchau.com.vn/bai-viet/thuoc-khang-acid-uong-tot-nhat-vao-luc-nao-1.html\">thuốc kh&aacute;ng acid</a>. Thuốc c&oacute; t&iacute;nh kiềm yếu, c&oacute; t&aacute;c dụng trung h&ograve;a m&ocirc;i trường acid ở dạ d&agrave;y m&agrave; kh&ocirc;ng ảnh hưởng đến sự tiết acid.</p>\n<h3>Dược động học</h3>\n<p>Chưa c&oacute; dữ liệu được b&aacute;o c&aacute;o.</p>\n</div>\n</div>\n<div id=\"detail-content-2\" class=\"dosage\">\n<h2 class=\"css-8uyn92\">C&aacute;ch d&ugrave;ng Hỗn dịch uống Phosphalugel</h2>\n<div>\n<h3>C&aacute;ch d&ugrave;ng thuốc Phosphalugel</h3>\n<p>Thuốc Phosphalugel dạng hỗn dịch d&ugrave;ng đường uống.</p>\n<p><a href=\"https://nhathuoclongchau.com.vn/bai-viet/thuoc-phosphalugel-uong-truoc-hay-sau-an-de-mang-lai-hieu-qua-tot-nhat.html\">C&aacute;ch d&ugrave;ng thuốc Phosphalugel</a>&nbsp;giảm đau dạ d