 liều 2,5mg/lần/ng&agrave;y.</li>\n</ul>\n<p><strong><em>Điều trị v&agrave; ph&ograve;ng ngừa huyết khối tĩnh mạch s&acirc;u v&agrave; tắc mạch phổi</em></strong>:</p>\n<ul>\n<li>Liều d&ugrave;ng khuyến nghị trong điều trị huyết khối tĩnh mạch s&acirc;u v&agrave; tắc mạch phổi: 10mg chia l&agrave;m 2 lần, trong 7 ng&agrave;y đầu ti&ecirc;n. Sau đ&oacute; giảm liều xuống 5mg chia l&agrave;m 2 lần.</li>\n<li>Liều d&ugrave;ng ph&ograve;ng ngừa huyết khối tĩnh mạch s&acirc;u v&agrave; tắc mạch phổi: 5mg chia l&agrave;m 2 lần.</li>\n</ul>\n<ul>\n<li><strong>C&aacute;ch d&ugrave;ng:</strong></li>\n</ul>\n<ul>\n<li>Thuốc Eliquis sử dụng đường uống, c&oacute; thể d&ugrave;ng c&ugrave;ng hoặc kh&ocirc;ng c&ugrave;ng thức ăn.</li>\n<li>Với bệnh nh&acirc;n kh&ocirc;ng c&oacute; khả năng nuốt cả vi&ecirc;n, vi&ecirc;n n&eacute;n Eliquis c&oacute; thể được nghiễn n&aacute;t v&agrave; khuấy v&agrave;o nước, hoặc đextrose 5% trong nước (DSW), hoặc nước tảo hoặc trộn với t&aacute;o xay nhuyễn v&agrave; d&ugrave;ng ngay qua đường uống.</li>\n</ul>\n<p><strong>5.&nbsp;</strong><strong>Chống chỉ định</strong></p>\n<ul>\n<li>Bệnh nh&acirc;n mẫn cảm với hoạt chất v&agrave; t&aacute; dược của thuốc.</li>\n<li>Bệnh nh&acirc;n đang bị xuất huyết đ&aacute;ng kể.</li>\n<li>Bệnh nh&acirc;n bị bệnh gan v&agrave; c&oacute; li&ecirc;n quan đến rối loạn đ&ocirc;ng m&aacute;u, xuất huyết.</li>\n<li>Bệnh nh&acirc;n xuất huyết đường ti&ecirc;u h&oacute;a, u &aacute;c t&iacute;nh c&oacute; nguy cơ xuất huyết.</li>\n<li>Chống chỉ định d&ugrave;ng đồng thời với c&aacute;c thuốc chống đ&ocirc;ng m&aacute;u kh&aacute;c..</li>\n</ul>\n<p><strong>6.&nbsp;</strong><strong>T&aacute;c dụng kh&ocirc;ng mong muốn</strong></p>\n<ul>\n<li>Rối loạn m&aacute;u v&agrave; hệ bạch huyết: thiếu m&aacute;u, xuất huyết, tụ m&aacute;u.</li>\n<li>Rối loạn ti&ecirc;u h&oacute;a: Buồn n&ocirc;n, n&ocirc;n.</li>\n<li>Xuất hiện vết bầm t&iacute;m.</li>\n</ul>\n<p><strong>7.&nbsp;</strong><strong>Tương t&aacute;c thuốc</strong>