y l&agrave; thuốc g&igrave;</strong></p>\n<p>Thuốc Eliquis 5 mg l&agrave; thuốc thuộc nh&oacute;m thuốc chống đ&ocirc;ng m&aacute;u. Thuốc n&agrave;y được sử dụng trong ph&ograve;ng ngừa v&agrave; điều trị huyết khối tĩnh mạch s&acirc;u, thuy&ecirc;n tắc phổi ở người lớn, ph&ograve;ng ngừa đột quỵ, thuy&ecirc;n tắc mạch to&agrave;n th&acirc;n.</p>\n<p><strong>3.&nbsp;</strong><strong>Chỉ định điều trị</strong></p>\n<ul>\n<li>Ph&ograve;ng ngừa biến cố thuy&ecirc;n tắc huyết khối tĩnh mạch (Venous Thromboembolic Events - VTE) ở bệnh nh&acirc;n trưởng th&agrave;nh đ&atilde; trải qua phẫu thuật thay thế khớp h&aacute;ng hoặc khớp gối theo chương tr&igrave;nh.</li>\n<li>Ph&ograve;ng ngừa đột quỵ v&agrave; thuy&ecirc;n tắc mạch to&agrave;n th&acirc;n ở bệnh nh&acirc;n trưởng th&agrave;nh bị rung nhĩ kh&ocirc;ng do bệnh van tim (NVAF), c&oacute; một hoặc nhiều yếu tố nguy cơ, như trước đ&oacute; đ&atilde; bị đột quỵ hoặc cơn thiếu m&aacute;u n&atilde;o cục bộ tho&aacute;ng qua (TIA); tuổi &ge; 75; tồng huyết &aacute;p; đ&aacute;i th&aacute;o đường; suy tim c&oacute; triệu chứng (&ge; độ II theo ph&acirc;n loại của Hiệp hội tim mạch New York - NYHA).</li>\n<li>Điều trị huyết khối tĩnh mạch s&acirc;u (DVT) v&agrave; thuy&ecirc;n tắc phổi (PE), v&agrave; ph&ograve;ng ngừa t&aacute;i ph&aacute;t huyết khối tĩnh mạch s&acirc;u v&agrave; thuy&ecirc;n tắc phổi ở người lớn.</li>\n</ul>\n<p><strong>4.&nbsp;</strong><strong>Liều d&ugrave;ng v&agrave; c&aacute;ch d&ugrave;ng</strong></p>\n<ul>\n<li><strong>Liều d&ugrave;ng:</strong></li>\n</ul>\n<p><strong><em>Ph&ograve;ng ngừa biến cố thuy&ecirc;n tắc huyết khối tĩnh mạch:</em></strong></p>\n<ul>\n<li>Liều: 2,5mg/lần x 2 lần/ng&agrave;y. Liều đầu ti&ecirc;n phải uống 12-24 giờ sau khi phẫu thuật.</li>\n<li>Với bệnh nh&acirc;n thay thế khớp gối d&ugrave;ng k&eacute;o d&agrave;i 10-14 ng&agrave;y.</li>\n<li>Với bệnh nh&acirc;n thay thế khớp h&aacute;ng duy tr&igrave; 32-38 ng&agrave;y.</li>\n</ul>\n<p><strong><em>Ph&ograve;ng đột quỵ v&agrave; tắc mạch to&agrave;n th&acirc;n:</em></strong></p>\n<ul>\n<li>Liều khuyến c&aacute;o 2,5mg lần x 2 lần/ng&agrave;y.</li>\n<li>C&oacute; thể giảm liều 2,5mg/lần/ng&agrave;y.</li>\n</ul>\n<p>&nbsp;</p>','',1,'2024-10-15 13:55:21',192,'2024-11-06 11:47:25',192,NULL,2215,38217),(234,3277,'common',70000,65000,100,5,'inactive',216,'dfdg dvfdg dfgfd \ndfdg dvfdg dfgfd \ndfdg dvfdg dfgfd  \ndfdg dvfdg dfgfd  \ndfdg dvfdg dfgfd \ndfdg dvfdg dfgfd ','',1,'2024-10-15 15:00:20',192,'2024-10-17 10:40:16',192,NULL,2262,38220),(235,3280,'common',6000,5000,30,0,'active',220,'kkj jjh jkn \nkkj jjh jkn\nkkj jjh jkn gjk jk kb\nkkj jjh jkn','',1,'2024-10-16 11:05:24',195,'2024-10-16 11:05:24',195,NULL,2264,38226),(236,3280,'common',3000,3000,10,0,'active',220,'kkj jjh jkn \nkkj jjh jkn\nkkj jjh jkn gjk jk kb\nkkj jjh jkn','',1,'2024-10-16 11:21:17',195,'2024-10-16 11:21:17',195,'2024-10-16 11:26:29',2264,38225),(237,3280,'common',3000,0,2,0,'active',220,'kkj jjh jkn \nkkj jjh jkn\nkkj jjh jkn gjk jk kb\nkkj jjh jkn','',1,'2024-10-16 11:28:16',195,'2024-10-16 11:28:16',195,NULL,2264,38225),(238,2751,'common',6000,0,500,0,'active',200,'<p>fghj</p>','2273',1,'2024-10-16 12:08:09',178,'2024-10-23 14:18:21',178,NULL,2271,36356),(239,3279,'common',70000,65000,2000,0,'active',220,'','',1,'2024-10-16 12:11:13',195,'2024-10-18 14:15:20',195,'2024-10-18 14:18:02',2263,38224),(240,3283,'common',25000,20000,20,4,'active',216,'gh. hjvh hvcg g c bc v. bn g. h dc gmjg hhc ','2283/2284/2285',1,'2024-10-17 11:36:11',192,'2024-10-29 16:02:19',192,NULL,2279,38231),(241,3283,'common',50000,24000,30,0,'active',216,'gh. hjvh hvcg g c bc v. bn g. h dc gmjg hhc ','2286',1,'2024-10-17 11:36:45',192,'2024-10-17 11:36:45',192,'2024-10-17 11:38:00',2279,38232),(242,3283,'common',50000,45000,50,2,'active',216,'gh. hjvh hvcg g c bc v. bn g. h dc gmjg hhc ','2287',1,'2024-10-17 11:39:12',192,'2024-10-29 16:02:19',192,NULL,2279,38232),(243,3285,'common',1500,1400,100,0,'inactive',169,'','',1,'2024-10-17 14: