us citric acid.</p>\n<p>Dạng b&agrave;o chế: Bột pha ti&ecirc;m.</p>\n<p><strong>2.&nbsp;</strong><strong>Thuốc n&agrave;y l&agrave; thuốc g&igrave;</strong></p>\n<p>Fosfomycin l&agrave; 1 dẫn xuất của Acid Fosfonic, được tổng hợp hoặc tinh chế từ Streptomyces fradiae v&agrave; c&aacute;c chủng Streptomyces kh&aacute;c.</p>\n<p>&nbsp;</p>\n<p><strong>3.&nbsp;</strong><strong>Chỉ định điều trị</strong></p>\n<p>C&aacute;c loại vi khuẩn nhạy cảm với fosfomycin như chủng Staphylococcus sp., chủng Escherichia coli, chủng Shigella sp., Salmonella sp., chủng Pseudomonas aeruginosa v&agrave; 1 số chủng kh&aacute;c.</p>\n<p>Fosfomicin sẽ được sử dụng điều trị cho c&aacute;c loại nhiễm khuẩn do vi khuẩn nhạy cảm g&acirc;y ra trong c&aacute;c bệnh như:</p>\n<ul>\n<li>Nhiễm khuẩn s&acirc;u tr&ecirc;n da.</li>\n<li>Vi&ecirc;m ruột nhiễm khuẩn.</li>\n<li>Chắp lẹo.</li>\n<li>Vi&ecirc;m sụn mi.</li>\n<li>Vi&ecirc;m xoang</li>\n<li>Vi&ecirc;m b&agrave;ng quang.</li>\n<li>Vi&ecirc;m t&uacute;i lệ.</li>\n<li>Vi&ecirc;m tai giữa.</li>\n</ul>\n<p><strong>4.&nbsp;</strong><strong>Liều d&ugrave;ng v&agrave; c&aacute;ch d&ugrave;ng</strong></p>\n<p><strong>Liều d&ugrave;ng:</strong></p>\n<ul>\n<li>Nếu truyền IV, pha với 100-500 mL dịch, truyền trong 1-2 giờ, liều 1 ng&agrave;y chia ra 2 lần truyền.</li>\n<li>Nếu ti&ecirc;m IV, pha với 20mL dịch, ti&ecirc;m chậm tr&ecirc;n 5 ph&uacute;t, liều 1 ng&agrave;y chia ra 2-4 lần ti&ecirc;m..</li>\n</ul>\n<p><strong>C&aacute;ch d&ugrave;ng:</strong>&nbsp;Thuốc Fosfomycin 2g được b&agrave;o chế dưới dạng bột pha ti&ecirc;m n&ecirc;n thuốc cần được h&ograve;a tan trong dung mỗi l&agrave; nước cất pha ti&ecirc;m hoặc dung dịch Glucose 5%. Thuốc c&oacute; thể được ti&ecirc;m theo đường tĩnh mạch hoặc truyền tĩnh mạch.</p>\n<p>Mọi thao t&aacute;c ti&ecirc;m để sử dụng thuốc phải được thực hiện bởi nh&acirc;n vi&ecirc;n y tế.</p>\n<p><strong>5.&nbsp;</strong><strong>Chống chỉ định</strong></p>\n<ul>\n<li>Kh&ocirc;ng sử dụng thuốc Fosfomycin thuốc biệt dược cho người c&oacute; tiền sử mẫn cảm với bất k&igrave; th&agrave;nh phần n&agrave;o c&oacute; trong thuốc.</li>\n<li>Bệnh nh&acirc;n bị vi&ecirc;m thận hay l&agrave; bể thận.</li>\n<li>C&aacute;c bệnh nh&acirc;n bị &aacute;p xe quanh thận.</li>\n</ul>\n<p><strong>6.&nbsp;</strong><strong>T&aacute;c dụng kh&ocirc;ng mong muốn</strong></p>\n<ul>\n<li>Phản ứng bất lợi nghi&ecirc;m trọng kh&aacute;c xuất hiện tr&ecirc;n l&acirc;m s&agrave;ng: Vi&ecirc;m kết tr&agrave;ng với ph&acirc;n bị lẫn m&aacute;u nặng như l&agrave; bị vi&ecirc;m kết tr&agrave;ng giả mạc. Theo d&otilde;i v&agrave; n&ecirc;n ngừng sử dụng thuốc ngay v&agrave; xử tr&iacute; th&iacute;ch hợp nếu như c&oacute; ph&aacute;t hiện bệnh nh&acirc;n bị đau bụng hay hay ti&ecirc;u chảy&hellip;</li>\n<li>Rối loạn đường ti&ecirc;u h&oacute;a:&nbsp; bị ti&ecirc;u chảy, đi ngo&agrave;i ph&acirc;n lỏng hay tức bụng, ch&aacute;n ăn, kh&oacute; ti&ecirc;u, đầy hơi, &hellip;</li>\n<li>Rối loạn gan mật (như bị tăng AST,&nbsp; ALT ).</li>\n<li>Rối loạn da, m&ocirc; mềm (như bị ph&aacute;t ban, ngứa, nổi m&agrave;y đay&hellip;).</li>\n<li>Rối loạn tr&ecirc;n to&agrave;n th&acirc;n (như bị đau đầu, hay&nbsp; ph&ugrave;&hellip;).</li>\n</ul>','2338/2339/2340',1,'2024-10-31 14:18:53',193,'2024-11-14 10:48:40',193,NULL,2322,38266),(269,3300,'private',30000,28000,100,6,'active',218,'<p><strong>1. Th&agrave;nh phần hoạt chất</strong></p>\n<p>Mỗi ml chứa Brinzolamid 10mg v&agrave; t&aacute; dược vừa đủ</p>\n<p><strong>2. Thuốc n&agrave;y l&agrave; thuốc g&igrave;</strong></p>\n<p>Thuốc nhỏ mắt điều trị tăng nh&atilde;n &aacute;p</p>\n<p><strong>3. Chỉ định điều trị</strong></p>\n<p>Hỗn dịch nhỏ mắt brinzolamid 1% được chỉ định như một liệu ph&aacute;p đơn trị liệu để l&agrave;m giảm tăng nh&atilde;n &aacute;p tr&ecirc;n bệnh nh&acirc;n l&agrave; người lớn bị tăng nh&atilde;n &aacute;p hoặc gl&ocirc;c&ocirc;m g&oacute;c mở kh&ocirc;ng đ&aacute;p ứng hoặc c&oacute; chống chỉ định với c&aacute;c thuốc đối kh&aacute;ng thụ thể beta, hoặc điều trị hỗ trợ c&aacute;c thuốc dối kh&aacute;ng thụ thể beta hay nh&oacute;m thuốc tương tự prosgaglandin</p>\n<p><strong>4. Liều d&ugrave;ng v&agrave; c&aacute;ch d&ugrave;ng</strong></p>\n<p><em>* Liều d&ugrave;ng:</em></p>\n<p>Liều d&ugrave;ng của brinzolamid 1% để điều trị tăng nh&atilde;n &aacute;p cho bệnh nh&acirc;n người lớn bị tăng nh&atilde;n &aacute;p hoặc gl&ocirc;c&ocirc;m g&oacute;c mở như sau:</p>\n<p>- Nhỏ 1 gọt hỗn dịch Azopt v&agrave;o mắt người bệnh 2-3 lần mỗi ng&agrave;y, kh&ocirc;ng n&ecirc;n nhỏ qu&aacute; 1 giọt/lần v&agrave;o mắt bị bệnh 2-3 lần mỗi ng&agrave;y</p>\n<p>- Khi d&ugrave;ng hỗn dịch AZOPT thay thế cho một thuốc điều trị gl&ocirc;c&ocirc;m kh&aacute;c, phải ngưng d&ugrave;ng c&aacute;c thuốc đ&oacute; một ng&agrave;y rồi mới bắt đầu d&ugrave;ng hỗn dịch AZOPT v&agrave;o ng&agrave;y kế tiếp. Nếu bệnh nh&acirc;n sử dụng đồng thời nhiều hơn một thuốc nhỏ mắt, c&aacute;c thuốc cần phải được nhỏ mắt c&aacute;ch nhau &iacute;t nhất l&agrave; 10 ph&uacute;t</p>\n<p>- Sử dụng ở trẻ em: Hiệu quả v&agrave; độ an to&agrave;n của hỗn dịch AZOPT ở trẻ em dưới 18 tuổi chưa được x&aacute;c lập. V&igrave; vậy kh&ocirc;ng khuyến c&aacute;o sử dụng cho đối tượng n&agrave;y</p>\n<p>- Sử dụng ở người cao tuổi: Kh&ocirc;ng cần hiệu chỉnh liều khi d&ugrave;ng thuốc cho người cao tuổi</p>\n<p>- Sử dụng ở người suy gan, thận:</p>\n<p>Thuốc chưa được nghi&ecirc;n cứu tr&ecirc;n bệnh nh&acirc;n suy gan. V&igrave; vậy kh&ocirc;ng khuyến c&aacute;o sử dụng cho đối tượng n&agrave;y</p>\n<p>Thuốc chưa được nghi&ecirc;n cứu tr&ecirc;n bệnh nh&acirc;n suy thận nặng (Độ thanh thải creatinin &lt; 30 mL/ph&uacute;t). V&igrave; Brinzolamide v&agrave; c&aacute;c chất chuyển h&oacute;a ch&iacute;nh thải trừ chủ yếu qua thận, chống chỉ định hỗn dịch AZOPT ở bệnh nh&acirc;n suy thận nặng</p>\n<p><em>* C&aacute;ch d&ugrave;ng:</em></p>\n<p>Lắc kỹ lọ thuốc trước khi d&ugrave;ng. Chỉ d&ugrave;ng để nhỏ mắt</p>\n<p><strong>5. Chống chỉ định</strong></p>\n<p>- Bệnh nh&acirc;n mẫn cảm với th&agrave;nh phần brinzolamid hoặc bất kỳ th&agrave;nh phần n&agrave;o của thuốc hoặc c&aacute;c sulphonamid</p>\n<p>- Bệnh nh&acirc;n suy thận nặng</p>\n<p>- Nhiễm toan chuyển h&oacute;a tăng clo huyết</p>\n<p><strong>6. T&aacute;c dụng kh&ocirc;ng mong muốn</strong></p>\n<p>- Vi&ecirc;m mũi họng, vi&ecirc;m xoang, vi&ecirc;m họng</p>\n<p>- &Iacute;t gặp: Giảm hồng cầu, tăng clo m&aacute;u, thờ ơ ch&aacute;n nản, vi&ecirc;m gi&aacute;c mạc, đổi m&agrave;u gi&aacute;c mạc, kh&ocirc; mắt ch&oacute;i mắt, suy tim chậm nhịp tim, trống ngực, kh&oacute; thở, chảy m&aacute;u cam&hellip;.</p>\n<p>- Đau đầu, rối loạn chức năng vận động, ch&oacute;ng mặt</p>\n<p>- Nh&igrave;n mờ, k&iacute;ch ứng mắt, đau mắt, cảm gi&aacute;c c&oacute; vật lạ, sung huyết mắt</p>\n<p>- Loạn vị gi&aacute;c</p>\n<p><strong>7. Tương t&aacute;c thuốc</strong></p>\n<p>- C&aacute;c nghi&ecirc;n cứu về tương t&aacute;c thuốc cụ thể giữa Azopt với c&aacute;c thuốc kh&aacute;c chưa được thực hiện</p>\n<p>- Trong c&aacute;c thử nghiệm l&acirc;m s&agrave;ng, kh&ocirc;ng c&oacute; bằng chứng về c&aacute;c tương t&aacute;c bất lợi khi sử dụng đồng thời Azopt với c&aacute;c chất tương tự prostaglandin v&agrave; c&aacute;c chế phẩm nhỏ mắt chứa timolol. Sự phối hợp giữa Azopt v&agrave; c&aacute;c thuốc co đồng tử hoặc c&aacute;c thuốc chủ vận adrenergic trong suốt liệu ph&aacute;p điều trị bổ trợ bệnh gl&ocirc;c&ocirc;m chưa được đ&aacute;nh gi&aacute;</p>\n<p>- Azopt l&agrave; thuốc ức chế carbonic anhydrase v&agrave; mặc d&ugrave; d&ugrave;ng tại chỗ, thuốc dược hấp thu to&agrave;n th&acirc;n. Đ&atilde; c&oacute; b&aacute;o c&aacute;o về c&aacute;c rối loạn c&acirc;n bằng acid-base với c&aacute;c thuốc ức chế carbonic anhydrase đường uống</p>\n<p>- C&oacute; thể c&oacute; c&aacute;c t&aacute;c dụng phụ ngo&agrave;i c&aacute;c t&aacute;c dụng to&agrave;n th&acirc;n đ&atilde; biết của việc ức chế carbonic anhydrase ở c&aacute;c bệnh nh&acirc;n d&ugrave;ng thuốc ức chế CA đường uống v&agrave; Azopt</p>\n<p><strong>8. Dược động học</strong></p>\n<p><em>- Hấp thu</em></p>\n<p>Sau khi nhỏ thuốc nhỏ mắt Azopt, brinzolamid được hấp thu v&agrave;o hệ tuần ho&agrave;n v&agrave; t&iacute;ch lũy trong c&aacute;c tế b&agrave;o hồng cầu với thời gian b&aacute;n thải l&agrave; 111 ng&agrave;y. Nồng độ brinzolamid trong c&aacute;c tế b&agrave;o hồng cầu sau thời gian d&agrave;i uống v&agrave; nhỏ mắt đạt tới nồng độ b&atilde;o h&ograve;a trung m&igrave;nh l&agrave; 20&micro;M. Nồng độ binzolamid n&agrave;y tương tự với nồng độ trong hồng cầu (22-27&micro;M) đạt được sau khi uống liều brinzolamid 1mg ng&agrave;y 2 lần trong 32 tuần. Ngo&agrave;i ra chất chuyển h&oacute;a N-desacetyl brinzolamid cũng t&iacute;ch lũy trong c&aacute;c tế b&agrave;o hồng cầu sau khi nhỏ mắt v&agrave; uống thuốc</p>\n<p><em>- Ph&acirc;n bố</em></p>\n<p>Brinlazomid gắn kết vừa phải với c&aacute;c protein huyết tương (khoảng 60%) do đ&oacute; nguy cơ tương t&aacute;c với c&aacute;c thuốc kh&aacute;c m&agrave; cũng gắn kết với c&aacute;c protein huyết tương l&agrave; thấp. Dựa tr&ecirc;n c&aacute;c nghi&ecirc;n cứu tr&ecirc;n thỏ l&ocirc;ng trắng hoặc thỏ l&ocirc;ng m&agrave;u cho thấy brinzolamid gắn kết vừa phải với melanin. Tuy nhi&ecirc;n thời gian b&aacute;n thải của brinzolamid tr&ecirc;n c&aacute;c m&ocirc; của thỏ bị ảnh hưởng nhiều hơn bởi sự gắn kết hồng cầu so với gắn kết melanin</p>\n<p><em>- Chuyển h&oacute;a</em></p>\n<p>N-desethyl brinzolamid l&agrave; chất chuyển h&oacute;a ch&iacute;nh được t&igrave;m thấy trong m&aacute;u v&agrave; nước tiểu. Chất chuyển h&oacute;a n&agrave;y được biết cũng ức chế carbonic anhydrase. Cytochrome P-450 CYP3A4 l&agrave; enzym ch&iacute;nh cho sự h&igrave;nh th&agrave;nh chất chuyển h&oacute;a n&agrave;y, tuy nhi&ecirc;n, P-450s c&ograve;n tham gia v&agrave;o sự thải trừ brinzolamid. Ở nồng độ l&ecirc;n tới 1000ng/ml, cao gấp 100 lần so với nồng độ huyết tương người ở trạng th&aacute;i ổn dịnh, brinzolamid kh&ocirc;ng ức chế bởi P-450s</p>\n<p><em>- Thải trừ</em></p>\n<p>Brinzolamid được thải trừ chủ yếu qua th&acirc;n ở dạng kh&ocirc;ng đổi (60%) v&agrave; 20% kh&aacute;c được thải trừ qua chuyển h&oacute;a ở gan</p>','2341/2342',1,'2024-10-31 14:28:57',193,'2024-11-04 10:47:07',193,NULL,2321,38264),(270,3316,'private',90000,0,16,1,'inactive',169,'','',1,'2024-11-02 15:09:29',131,'2024-11-29 17:35:32',131,NULL,2390,38293),(271,3321,'common',30000,25000,100,2,'active',216,'','2416/2417/2418',1,'2024-11-11 10:01:15',192,'2024-11-13 12:05:52',192,NULL,2415,38302),(272,3322,'common',30000,25000,100,4,'active',216,'','',1,'2024-11-12 15:59:33',192,'2024-11-30 12:58:16',192,NULL,2423,38303),(273,3325,'common',20000,18000,150,5,'active',218,'','',1,'2024-11-14 10:47:05',193,'2024-11-15 17:53:06',193,NULL,2424,38310),(274,3326,'common',30000,25000,100,8,'inactive',218,'','',1,'2024-11-15 14:27:27',193,'2024-11-30 11:18:32',193,NULL,2425,38311),(275,15812,'common',79000,79000,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39629),(276,15813,'common',52000,52000,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39630),(277,15814,'common',42000,42000,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39631),(278,15815,'common',25500,25500,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39632),(279,15816,'common',39000,39000,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39633),(280,15817,'common',32500,32500,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39634),(281,15818,'common',146500,146500,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39635),(282,15819,'common',84000,84000,0,0,'active',227,NULL,NULL,1,'2024-11-15 16:53:24',NULL,'2024-11-15 16:53:24',NULL,NULL,NULL,39636),(283,15820,'common',81