 (Atractylodes macrocephala) 200mg\n\nCao Mộc hoa trắng (Holarrhena antidysenteria) 150 mg\n\nLactobacillus sporogense 1.10^8 CFU\n\nProtease 160 IU\n\nAmylase 550 IU\n\nCao Đảng sâm (Codonopsis pilosula) 50mg\n\nCao Bạch phục linh (Poria cocos Wolf.) 50mg\n\nCao Bạch thược ((Paeonia lactiflora Pall.) 50mg\n\nCao Hoàng bá (Phellodendron amurense) 50mg\n\nInulin 50mg, Lactase 100 IU\n\nSaccharomyces boulardii 1.10^8 CFU\n\nLipase 30 IU, Berberin 10 mg\n\nKẽm gluconat 5mg\n\nCellulase 5 IU\n\nPhụ liệu: Vỏ nang Gelatin, Chất chống đông vón (Magnesi stearate, Bột talc (553(iii)) vừa đủ (Khối lượng tịnh/ viên: mg ± 7.5%)\n\nCÔNG DỤNG\n\nGiúp bổ sung lợi khuẩn có ích cho đường ruột, enzyme tiêu hóa, hỗ trợ tiêu hóa và hấp thu thức ăn, giúp ăn ngon miệng.\n\nHỗ trợ giảm rối loạn tiêu hóa, hội chứng đại tràng kích thích do loạn khuẩn đường ruột.\n\nĐỐI TƯỢNG SỬ DỤNG\n\nNgười bị loạn khuẩn đường ruột với biểu hiện: tiêu chảy, phân sống, đầy bụng, khó tiêu, co thắt đại tràng.\nNgười dùng kháng sinh kéo dài gây loạn khuẩn đường ruột.\n\nBẢO QUẢN\n\nNơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp, nhiệt độ dưới 30 độ C. Để xa tầm tay của trẻ em.\n\nCÁCH DÙNG\n\nNgiời lớn: Uống 1-2 viên/lần x 2 lần/ngày. Nên sử dụng liên tục 1 liệu trình từ 3-6 tháng để có hiệu quả tốt nhất\n\nĐKSP: 9360/2018/ĐKSP\n\nGPQC: 00299/2019/XNQC\n\nLƯU Ý\n\nKhông sử dụng nếu có phản ứng không mong muốn hoặc mẫn cảm với bất kỳ thành phần nào của sản phẩm . Thực phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh.\n\nTHỰC PHẨM NÀY KHÔNG PHẢI LÀ THUỐC, KHÔNG CÓ TÁC DỤNG THAY THẾ THUỐC CHỮA BỆNH','',1,'2024-11-27 22:40:06',121,'2024-11-27 22:42:23',121,NULL,2441,964),(27506,43103,'common',2000,1000,100,0,'active',235,NULL,'',1,'2024-11-30 11:01:55',209,'2024-11-30 11:01:55',209,NULL,2442,66873),(27507,43102,'common',52000,50000,101,0,'inactive',235,NULL,'',1,'2024-11-30 11:03:10',209,'2024-11-30 17:01:46',209,NULL,2443,66872);
